export const DisplayList = ({start,size,facts}) =>{
    const formattedFacts =()=>{
        facts.slice(start,start+size).map(fact => 
            (<li key= {facts.indexOf(fact)} data-index={facts.indexOf(fact)}>{fact}</li>)
        );
    } 
    return (
        <ul>
            {formattedFacts}
        </ul>
    )
}
